Application.ScrollMagic.Scenes.Education=function(){const TIMELINE=(new TimelineMax).fromTo("[data-target='educationTitle']",2,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0});for(const[index,element]of Object.entries(document.querySelectorAll('[data-target="educationCard"]')))TIMELINE.fromTo(element,1.5,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0},(index+3)/2);return Application.Layout.set("Education",new ScrollMagic.Scene({triggerElement:"#education",triggerHook:.78,duration:"70%"}).setTween(TIMELINE).addTo(Application.ScrollMagic.Controllers.Main)),!0};